const userReducer = (state = { getDetails: [] }, action) => {
  switch (action.type) {
    case "CREATE_USERS":
      return Object.assign({}, action.payload);
      break;
    case "USER_LOGIN":
      return Object.assign({}, { state }, { getDetails: action.payload });
  }
  return state;
};

export default userReducer;
